import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import HabitsList from "./components/habits-list.component";
import EditHabit from "./components/edit-habit.component";
import CreateUser from "./components/create-user.component";
import CreateHabit from "./components/create-habit.component";
import Home from "./components/home.component";
import Dashboard from "./components/dashboard.component";

function App() {
  const [user, setUser] = useState(null);

  useEffect(() => {
    axios({
      method: "GET",
      withCredentials: true,
      url: "http://localhost:5000/user",
    }).then((res) => {
      setUser(res.data);
      console.log(res.data);
    });
  }, []);

  return (
    <Router>
      <div className="container">
        {user ? (
          <Route path="/dashboard" exact component={Dashboard} user={user} />
        ) : (
          <Route path="/unregistered" exact component={Home} />
        )}
      </div>
    </Router>
  );
}

export default App;
